import React from 'react'
import './Login.css';
import Input_login from './Input_login';
import PersonIcon from '@material-ui/icons/Person';
import LockIcon from '@material-ui/icons/Lock';
import Avatar from '@material-ui/core/Avatar';

function Login() {
    return (
        <div className="Login__part">

            <div className="Login__input">
                {/* <Avatar className="Login__avatar"/> */}
                <h1 className="Login__header">Login part</h1>

                <Input_login Icon={PersonIcon} />
                <Input_login Icon={LockIcon} />

                <button className="Login__button" type="submit" >Login</button>
                <div className="Input__checkbox">
                    
                        <input type="checkbox" />
                        <h4 className="Input__rememberme">rememberme</h4>
                        <a className="Input__forgotpass" href="https://google.com">Forgot Password</a>
                    
                    
                </div>

              
            </div>
            <hr></hr>

        </div>

    )
}

export default Login
